import React from 'react';

const MovieCard = ({ movie: {Title, Year, Language, Overview, Popularity, Runtime, Type, Genres, Companies, Countries, SpokenLanguages, PosterLink, URL, RatingValue, RatingCount } }) => {
  return (
    <div className="movie">
      <div>
        <p>Year</p>
      </div>

      <div>
        <img src={PosterLink !== "N/A" ? PosterLink : "https://via.placeholder.com/400"} alt={Title} />
      </div>

      <div>
        <span>Movie</span>
        <h3>{Title}</h3>
      </div>
    </div>
  );
}

export default MovieCard;
